import React from "react";
import { Link } from "react-router-dom";
import "./css/mainNav.css";

const MainNav = () => {
  return (
    <nav className="d-sm-flex justify-content-around bg-dark text-white">
      <div>
        <img src="" alt="OY Technology Pvt. Ltd." />
      </div>
      <div>
        <Link to="" className="px-1 px-sm-2 mx-sm-2 text-white links">
          Home
        </Link>
        <Link to="" className="px-sm-2 mx-sm-2 text-white links">
          About Us
        </Link>
        <Link to="" className="px-sm-2 mx-sm-2 text-white links">
          Services
        </Link>
        <Link to="" className="px-sm-2 mx-sm-2 text-white links">
          Pages
        </Link>
        <Link to="" className="px-sm-2 mx-sm-2 text-white links">
          Career
        </Link>
        <Link to="" className="px-sm-2 mx-sm-2 text-white links">
          Blogs
        </Link>
      </div>
    </nav>
  );
};

export default MainNav;
